INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(2, 'Raccordement Clients et Ingénierie', 'La délégation RCI assure la maîtrise d\'ouvrage de réalisation des réseaux électriques. Elle a en charge le développement du réseau et son renouvellement. Elle réalise l\'accueil et le traitement de toutes les demandes de raccordement jusqu\'à la mise en service. \r\nSur le marché d\'affaires, elle assure la gestion, la relève du parc comptage, et sa transposition en compteurs communicants PME PMI. \r\nL’agence « Haut de Portefeuille » gère des projets à enjeux pour la Ville de Paris et l\'agence « Appui et Pilotage » vient en soutien pour l\'ensemble des autres agences du service. Sur l\'aspect Client, le RCI regroupe\r\nles activités clientèle hors intervention d’Enedis à Paris : L’Acheminement, l’Écoute Client, les Grands Comptes et la Gestion Clients en Contrats d’Accès au Réseau de Distribution...', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(3, 'Prévention Santé et Sécurité Transformation', 'La délégation Transformation Santé Sécurité Environnement définit et pilote : le dispositif de Prévention Santé Sécurité auprès de la ligne managériale, des agents et des prestataires, la concordance de nos pratiques et de l\'application du prescrit, l\'ensemble de la ligne managériale pour la mise en place d\'actions Santé Sécurité sur l\'Unité et la politique environnement de l\'unité en cohérence avec les enjeux de la Ville de Paris.', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(4, 'Patrimoine et infrastructures', 'La délégation Patrimoine et Infrastructure a pour mission de piloter les processus relatifs au patrimoine technique, de la maitrise d\'ouvrage aux postes sources, ainsi que des fonctions relatives à la conduite, à l\'accès au réseau, aux études de raccordement des clients et ZAC au réseau HTA et à la cartographie. \r\nLe service propose des choix stratégiques d\'investissement pour que le réseau soit en capacité d\'atteindre les ambitions parisiennes et est garant des politiques de développement des réseaux. \r\nLa fiabilité est une exigence pour le service, les matériels, l\'infrastructure télécom ou pour les données patrimoniales (notamment cartographique).', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(5, 'Territoire et projets Transition Ecologique', 'La délégation Relation Territoire & projets Transition Ecologique veille à la mise en œuvre des engagements contractuels définis avec la Ville de Paris, tant sur les volumes d investissements réalisés chaque année que sur les résultats opérationnels relevé́, accessibilité des accueils téléphoniques, délais de raccordement...). \r\nDans le cadre de la transition écologique de Paris, les départements Smart City et Mobilité Electrique accompagnent la Ville et les grands acteurs en pilotant et animant des projets Smart Cities, Smart Grid , Data et Mobilité électrique et en proposant des actions innovantes.', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(6, 'Ressources Humaines', 'La délégation RH apporte un appui aux métiers par la mise à disposition des ressources et des compétences nécessaires à l\'accomplissement de leurs activités : recrutement, formation et professionnalisation, GPEC, gestion de la mobilité et des parcours professionnels. Par ses conseils, elle aide à la décision managériale.\r\n\r\n Elle décline les politiques nationales et garantit la prise en compte des enjeux RH. Elle assure le dialogue social et le pilotage des instances représentatives du personnel.', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(7, 'Communication', 'L’équipe Communication intervient en appui et conseil au management. Elle élabore et déploie les stratégies et les plans de communication, et s’assure de la qualité du contenu et de la diffusion de l’information. tous les métiers en interne et en externe, organise également des évènements permettant de souder les liens inter-agences.', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(8, 'Performance', 'La délégation performance est en charge de\r\n4 grands domaines : la gestion / finance de l\'unité,\r\nOPEX et CAPEX : établissement et suivi des budgets\r\navec les métiers, cycle de gestion, PMT, le contrôle\r\ninterne, l\'analyse des risques, la conformité et les\r\ndélégations, la logistique, l\'immobilier, les véhicules\r\net les achats.', );
INSERT INTO `domaines` (`id_domaines`, `nomDomaines`, `descriDomaines`, `imageDomaines`) VALUES
(9, 'Opérations', 'Assurer la qualité et la continuité de la fourniture d’électricité ; Assurer l’exploitation du réseau : gestion des accès et des dépannages, maintien en condition opérationnelle, traitement des incidents… ; Assurer la réalisation des interventions techniques pour les clients particuliers et petits professionnels ; Assurer la planification et la programmation des interventions sur le réseau et chez les clients. \r\n\r\nLa Délégation Opérations optimise le fonctionnement du réseau (minimisation des coupures sur incidents ou pour travaux, veille active, accès, etc.). Elle contribue aux travaux de raccordement, aux chantiers délibérés et veille à la sécurité des intervenants, des tiers et des biens.', );

